@VDombrovskis @PaoloGentiloni @NicolasSchmitEU @ecfin @EU_Social The Annual Sustainable Growth Strategy sets out the economic and employment policy strategy for the EU.

It places sustainability and social inclusion at the heart of the EU's economic policymaking, in line with the priorities of the #EUGreenDeal.

